import React, { Component } from "react";
import "../../css/mainpage.css";

class Mainpage extends Component {
  render() {
    return (
      <div>
        <div className="tempusMeaning">
          <div className="left photo" id="one" />

          <div className="right text">
            <p>
              <span className="textMeaning">
                ¿Te gustaría tener una forma más fácil de comunicarte con tus
                compañeros de equipo? ¡No te preocupes! Nuestro servicio cuenta
                con un chat privado integrado que te permite ir y hablar con
                ellos de manera muy sencilla. Así podrás resolver cualquier duda
                o problema de manera rápida y eficiente, sin tener que salir de
                la plataforma. ¡Prueba nuestro chat privado integrado y
                simplifica la comunicación con tu equipo!
              </span>
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default Mainpage;
